import mesto__logo from '../images/Mesto__logo.svg';

function Register() {
  return (
    <form className={`popup__form popup__form_${name}`} onSubmit={onSubmit}>
          <h2 className="popup__title">{title}</h2>
          <label className="popup__label">
        <input
          type="text"
          className="popup__input popup__input_type_name"
          name="name"
          id="input-name"
          placeholder="Имя"
          minLength={2}
          maxLength={40}
          required=""
          onChange={handleChangeName}
          value={name || ''}
        />
        <span className="input-name-error" />
      </label>
      <label className="popup__label">
        <input
          type="text"
          className="popup__input popup__input_type_description"
          name="about"
          id="input-about"
          placeholder="О себе"
          minLength={2}
          maxLength={200}
          onChange={handleChangeDescription}
          value={description || ''}
        />
        <span className="input-about-error" />
      </label>
          <button type="submit" className="button popup__save-button" >{textsubmit}</button>
        </form>
  )
}

export default Register;
